class vast_xml_entity(object):

    def handleImpression(self, dom, ad_entity):
        impression_nodes = dom.getElementsByTagName("Impression")
        impression_list = []

        if impression_nodes.length > 0:
            for impression_node in impression_nodes:
                try:
                    impression_list.append(impression_node.childNodes[0].data)
                except:
                    pass
            ad_entity["events"].append(
                {"event": "impression", "skip_flag": False, "abs_ts": 0, "rel_ts": 0, "request_url": impression_list})
            return True
        else:
            # print u"不存在Impression节点"
            return False

    def handleCreative(self, dom, ad_entity):
        # 获取素材时长
        duration = -1
        duration_nodes = dom.getElementsByTagName("Duration")
        duration_node = None
        if duration_nodes:
            duration_node = duration_nodes[0]
            try:
                duration_str = duration_node.childNodes[0].data
                s = duration_str.split(":")
                duration = int(s[2]) + 60 * int(s[1]) + 3600 * int(s[0])
            except:
                pass
            ad_entity['duration'] = duration

        if ad_entity["ad_type"] == "pause":
            duration = 5

        if duration > 0:
            tracking_events = ad_entity["events"]
            firstQuartileSec = math.floor(duration * 0.25)
            skip_firstQuartile = random_possibility.randomSkipImpression(firstQuartileSec)
            midpointSec = math.floor(duration * 0.5)
            skip_midpoint = random_possibility.randomSkipImpression(midpointSec)
            thirdQuartileSec = math.floor(duration * 0.75)
            skip_thirdQuartile = random_possibility.randomSkipImpression(thirdQuartileSec)
            completeSec = duration
            skip_complete = random_possibility.randomSkipImpression(completeSec)
            # 非视频广告不需要跳过
            if ad_entity["ad_type"] == "pause":
                clickablePeroid = 5
                skip_firstQuartile = False
                skip_midpoint = False
                skip_thirdQuartile = False
                skip_complete = False

            # 根据跳过的事件点，计算允许点击的时间范围
            clickablePeroid = 0;
            if skip_firstQuartile:
                clickablePeroid = firstQuartileSec
            elif skip_midpoint:
                clickablePeroid = midpointSec
            elif skip_thirdQuartile:
                clickablePeroid = thirdQuartileSec
            else:
                clickablePeroid = duration - 1

            # 随机产生一个click事件
            needClick = random_possibility.randomNeedClick(self.platform)
            clickSec = 0
            # print "needClick:%s" % needClick
            # print "clickablePeroid:%s" % clickablePeroid
            if needClick and clickablePeroid > 2:
                # print u"start to random a click action"
                if ad_entity["ad_type"] != "pause":
                    # print u"start get linear click elements"
                    clickSec = 2 + random.random() * (clickablePeroid - 2)
                    event = {"event": "click", "skip_flag": False, "abs_ts": clickSec, "rel_ts": 0, "request_url": []}
                    tracking_events.append(event);
                    # 获取点击相关信息
                    click_node = dom.getElementsByTagName("VideoClicks")
                    if click_node:
                        click_through_node = click_node[0].getElementsByTagName("ClickThrough")
                        ad_entity["click"]["click_through"] = click_through_node[0].childNodes[0].data
                        click_tracking_nodes = click_node[0].getElementsByTagName("ClickTracking")
                        for click_tracking_node in click_tracking_nodes:
                            ad_entity["click"]["click_tracking"].append(click_tracking_node.childNodes[0].data)
                else:
                    clickablePeroid = 5
                    clickSec = 1 + random.random() * clickablePeroid
                    event = {"event": "click", "skip_flag": False, "abs_ts": clickSec, "rel_ts": 0, "request_url": []}
                    tracking_events.append(event);
                    # 获取非视频广告
                    click_node = dom.getElementsByTagName("NonLinear")
                    if click_node:
                        # print u"start get nonlinear click elements"
                        click_through_node = click_node[0].getElementsByTagName("NonLinearClickThrough")
                        ad_entity["click"]["click_through"] = click_through_node[0].childNodes[0].data
                        click_tracking_nodes = click_node[0].getElementsByTagName("NonLinearClickTracking")
                        for click_tracking_node in click_tracking_nodes:
                            ad_entity["click"]["click_tracking"].append(click_tracking_node.childNodes[0].data)

            # print "clickSec:%s" % clickSec
            click_and_wait_sec = 0
            if clickSec > 0:
                if self.platform == "aphone" or self.platform == "iphone" or self.platform == "phone" or self.platform == "pad":
                    click_and_wait_sec = clickSec + random.random() * (14 - clickSec) + 1

            # 初始化各个事件
            if ad_entity["ad_type"] != "pause":
                tracking_events.append({"event": "firstQuartile", "skip_flag": skip_firstQuartile,
                                        "abs_ts": firstQuartileSec if firstQuartileSec < clickSec else firstQuartileSec + click_and_wait_sec,
                                        "rel_ts": 0, "request_url": []})
                tracking_events.append({"event": "midpoint", "skip_flag": skip_midpoint,
                                        "abs_ts": midpointSec if midpointSec < clickSec else midpointSec + click_and_wait_sec,
                                        "rel_ts": 0, "request_url": []})
                tracking_events.append({"event": "thirdQuartile", "skip_flag": skip_thirdQuartile,
                                        "abs_ts": thirdQuartileSec if thirdQuartileSec < clickSec else thirdQuartileSec + click_and_wait_sec,
                                        "rel_ts": 0, "request_url": []})
            tracking_events.append(
                {"event": "complete", "skip_flag": skip_complete, "abs_ts": duration + click_and_wait_sec, "rel_ts": 0,
                 "request_url": []})

            # 获取各个时间点及url
            tracking_events_node = dom.getElementsByTagName("TrackingEvents")
            handleableEvents = ['firstQuartile', 'midpoint', 'thirdQuartile', 'skip', 'complete']

            if tracking_events_node:
                tracking_nodes = tracking_events_node[0].getElementsByTagName("Tracking")
                for tracking_node in tracking_nodes:
                    if tracking_node.hasAttribute("event"):
                        event_name = tracking_node.getAttribute("event")
                        # event为skip的时候需要从skip节点获取触发时间点,并插入tracking_events
                        if event_name == "skip":
                            if tracking_node.hasAttribute("skip"):
                                skip_sec = int(tracking_node.getAttribute("skip"))
                                event = None
                                for skip_event in tracking_events:
                                    if skip_event["event"] == "skip" and skip_event["abs_ts"] == skip_sec:
                                        event = skip_event
                                        break
                                if event == None:
                                    skip_flag = random_possibility.randomSkipImpression(skip_sec)
                                    if skip_flag and skip_sec < clickablePeroid:
                                        clickablePeroid = skip_sec
                                    event = {"event": "skip", "skip_flag": skip_flag, "abs_ts": skip_sec, "rel_ts": 0,
                                             "request_url": []}
                                    tracking_events.append(event);
                                urls = event["request_url"]
                                if urls:
                                    urls.append(tracking_node.childNodes[0].data)
                                else:
                                    l = [tracking_node.childNodes[0].data, ]
                                    event["request_url"] = l
                        # 其他非skip事件
                        elif event_name in handleableEvents:
                            for event in tracking_events:
                                if event['event'] == event_name:
                                    urls = event["request_url"]
                                    if urls:
                                        urls.append(tracking_node.childNodes[0].data)
                                    else:
                                        l = [tracking_node.childNodes[0].data, ]
                                        event["request_url"] = l

            # 按时间先后顺序排序
            tracking_events.sort(key=lambda elem: elem["abs_ts"])
            # print tracking_events

    def handleVAST(self, dom):
        ad_list = []

        ad_nodes = dom.getElementsByTagName("Ad")
        for ad_node in ad_nodes:
            ad_entity = {"events": [], "click": {"click_through": "", "click_tracking": []}}
            ad_system_nodes = ad_node.getElementsByTagName("AdSystem")
            if ad_system_nodes.length > 0:
                ad_system = ''
                try:
                    ad_system = ad_system_nodes[0].childNodes[0].data
                except:
                    pass
                ad_entity["ad_system"] = ad_system

            ad_title_nodes = ad_node.getElementsByTagName("AdTitle")
            if ad_title_nodes.length > 0:
                ad_title = ''
                try:
                    ad_title = ad_title_nodes[0].childNodes[0].data
                except:
                    pass
                ad_entity["ad_title"] = ad_title

            ad_mid_nodes = ad_node.getElementsByTagName("Mid")
            if ad_mid_nodes.length > 0:
                ad_mid = ''
                try:
                    ad_mid = ad_mid_nodes[0].childNodes[0].data
                except:
                    pass
                ad_entity["ad_mid"] = ad_mid

            ad_entity["ad_type"] = ""
            if ad_node.hasAttribute("type"):
                ad_entity["ad_type"] = ad_node.getAttribute("type")

            ad_entity["ad_id"] = ""
            if ad_node.hasAttribute("id"):
                ad_entity["ad_id"] = ad_node.getAttribute("id")

            hasImpression = self.handleImpression(ad_node, ad_entity)
            if hasImpression == False:
                continue
            self.handleCreative(ad_node, ad_entity)
            ad_list.append(ad_entity)
        return ad_list

